import React from 'react';
import PropTypes from 'prop-types';
import styles from './styles.scss';


class Section extends React.Component {

    render() {
        const {
            data
        } = this.props;
        return (
            <div className={styles.container}>
              {data.name}
            </div>
        );
    }
}

export default Section;
